import React from "react";

import "./Auth.scss";

import { Block, Button } from "components";

const Auth = () => (
  <section className="auth">
    <div className="auth__content">
      <div className="auth__top">
        <h2>Log in</h2>
        <p>Log in to your account</p>
      </div>
      <Block>
        <Button type="primary" size="large">
          This is button
        </Button>
      </Block>
    </div>
  </section>
);

export default Auth;
